"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Age-related vision loss (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/age-related-vision-loss-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H28696431\">",
"      <span class=\"h1\">",
"       What causes age-related vision loss?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are many things that lead to vision loss as you get older. The most common are:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Cataracts &mdash; A cataract is a clouding of the lens of the eye (",
"        <a class=\"graphic graphic_figure graphicRef76735 \" href=\"UTD.htm?27/51/28465\">",
"         figure 1",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        Glaucoma &mdash; Glaucoma is a disease that damages the main nerve in the eye, called the optic nerve.",
"       </li>",
"       <li>",
"        Macular degeneration &mdash; Macular degeneration is a condition that damages the back of the eye, called the retina.",
"       </li>",
"       <li>",
"        Diabetic retinopathy &mdash; Diabetic retinopathy damages the retina, too. But in this case the damage is related to having blood sugar levels that are too high. This type of vision loss affects people with diabetes.",
"       </li>",
"       <li>",
"        Presbyopia &mdash; Presbyopia occurs when the lens of the eye can no longer focus the right way. Presbyopia often occurs as a result of aging.",
"       </li>",
"       <li>",
"        Refractive errors &mdash; Refractive errors, such as nearsightedness and farsightedness, happen when the cornea (a structure in the front of the eye) cannot focus light or images onto the back of the eye the right way. Refractive errors can occur at any age, but are common among older people.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H28696438\">",
"      <span class=\"h1\">",
"       Who should be tested for age-related vision loss?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Experts recommend that people have at least 1 full eye exam (called a &ldquo;comprehensive eye exam&rdquo;) after they turn 40.",
"     </p>",
"     <p>",
"      If you are 40 or older, you should be tested even if your vision is fine. That&rsquo;s because many eye conditions do not affect vision until they are very advanced. By then, it might be too late to protect your vision. But if you catch a problem early, you can sometimes prevent vision loss.",
"     </p>",
"     <p>",
"      During the comprehensive eye exam, an eye doctor:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Looks into the back of your eye with a magnifying tool to check for signs of nerve damage.",
"       </li>",
"       <li>",
"        Checks how well you see things in the center of focus, and how well you see things that are off to the side.",
"       </li>",
"       <li>",
"        Checks the pressure inside your eye by pushing or blowing on your eye with a special tool. People with glaucoma often have too much pressure inside the eye.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H28696445\">",
"      <span class=\"h1\">",
"       What treatments are available?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It depends on the cause of vision loss. For instance, people with cataracts can have surgery to replace the lens in their eye. People with glaucoma can take drops to lower the pressure inside their eyes. With some forms of vision loss, early treatment is very important, because it can prevent further vision loss. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H28696452\">",
"      <span class=\"h1\">",
"       Can age-related vision loss be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. You can reduce your chances of developing vision loss by:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Not smoking (or quitting if you already smoke)",
"       </li>",
"       <li>",
"        Keeping your blood sugar and blood pressure levels as close to normal as possible if you have diabetes or high blood pressure",
"       </li>",
"       <li>",
"        Wearing goggles or other types of eye protection when you use heavy machinery or do anything that could hurt your eyes",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      There is also some evidence that eating a diet rich in fruits and vegetables and low in fat and cholesterol can help prevent vision loss. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H28696459\">",
"      <span class=\"h1\">",
"       What if I already have age-related vision loss?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you already have vision loss, remember that there are tools that can help you make the most of the vision you have left. For instance, there are:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Magnifying devices that mount on the TV and other screens",
"       </li>",
"       <li>",
"        Large print books",
"       </li>",
"       <li>",
"        Computer programs that allow your computer to read aloud to you",
"       </li>",
"       <li>",
"        Braille books &mdash; Braille is a form of language that uses raised dots. People who are blind read braille by passing their fingers over these dots.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H28696541\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
