"    <div id=\"topicTitle\">",
"     Patient information: Diet and health (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/diet-and-health-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H26962714\">",
"      <span class=\"h1\">",
"       Why is it important to eat a healthy diet?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It&rsquo;s important to eat a healthy diet because eating the right foods can keep you healthy now and later on in life.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26962721\">",
"      <span class=\"h1\">",
"       Which foods are especially healthy?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Foods that are especially healthy include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Fruits and vegetables &mdash; Eating fruits and vegetables can help prevent heart disease and strokes. Eating them might also help prevent certain types of cancers. Try to eat fruits and vegetables at each meal and for snacks. If you don&rsquo;t have fresh fruits and vegetables, you can eat frozen or canned ones instead. Doctors recommend eating 5 or more servings of fruits and vegetables each day.",
"       </li>",
"       <li>",
"        Foods with fiber &mdash; Eating foods with a lot of fiber can help prevent heart disease and strokes. If you have type 2 diabetes, it can also help control your blood sugar. Foods that have a lot of fiber include vegetables, fruits, beans, nuts, oatmeal, and some breads and cereals. You can tell how much fiber is in a food by reading the nutrition label (",
"        <a class=\"graphic graphic_figure graphicRef51585 \" href=\"UTD.htm?38/31/39413\">",
"         figure 1",
"        </a>",
"        ). Doctors recommend eating 20 to 35 grams of fiber each day.",
"       </li>",
"       <li>",
"        Foods with folate (also called",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?24/57/25492?source=see_link\">",
"         folic acid",
"        </a>",
"        ) &mdash; Folate is a vitamin that is important for pregnant women and women who plan to get pregnant. Pregnant women need to get enough folate so that their unborn baby can grow normally. Folate is found in many breakfast cereals, oranges, orange juice, and green leafy vegetables.",
"       </li>",
"       <li>",
"        Foods with calcium and vitamin D &mdash; Babies, children, and adults need calcium and vitamin D to help keep their bones strong. Adults also need calcium and vitamin D to help prevent osteoporosis. Osteoporosis is a condition that causes bones to get thin and break more easily than usual. Different foods and drinks have calcium and vitamin D in them (",
"        <a class=\"graphic graphic_figure graphicRef79375 \" href=\"UTD.htm?18/13/18647\">",
"         figure 2",
"        </a>",
"        ). People who don&rsquo;t get enough calcium and vitamin D in their diet might need to take a supplement. Supplements are pills, capsules, liquids, or tablets that have nutrients in them.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26962728\">",
"      <span class=\"h1\">",
"       What about fats?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are different types of fats. Some types of fats are better for your body than others. Unhealthy fats are:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Trans fats &mdash; These are found in margarines, many fast foods, and some store-bought baked goods.",
"       </li>",
"       <li>",
"        Saturated fats &mdash; These are found in red meats, butter, and many cheeses.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Both trans fats and saturated fats can raise your cholesterol level and your chance of getting heart disease. Try to avoid eating foods with these types of fats.",
"     </p>",
"     <p>",
"      Healthier fats are:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Monounsaturated fats",
"       </li>",
"       <li>",
"        Polyunsaturated fats",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      When you cook, use oils with these healthier fats, such as olive oil and canola oil.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26962735\">",
"      <span class=\"h1\">",
"       What about alcohol?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People who drink a small amount of alcohol each day might have a lower chance of getting heart disease. But drinking alcohol can lead to problems. For example, it can raise a person&rsquo;s chances of getting liver disease and certain types of cancers.",
"     </p>",
"     <p>",
"      Most doctors recommend that adult women not have more than 1 drink a day and that adult men not have more than 2 drinks a day.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26962742\">",
"      <span class=\"h1\">",
"       How many calories do I need each day?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The number of calories you need each day depends on your weight, height, age, sex, and how active you are.",
"     </p>",
"     <p>",
"      Your doctor or nurse can tell you how many calories you should eat each day. If you are trying to lose weight, you should eat fewer calories each day.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26962749\">",
"      <span class=\"h1\">",
"       What if I have questions?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you have questions about which foods you should or should not eat, ask your doctor or nurse. The right diet for you will depend, in part, on your health and any medical conditions you have.",
"     </p>",
