"   <a href=\"?imageKey=DERM%2F74154%7EDERM%2F56113%7EDERM%2F82198%7EDERM%2F50218&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
