"      <td rowspan=\"5\">",
"       NSVT, LVEF &ge;0.40: generally considered to have good prognosis",
"      </td>",
"      <td>",
"       No, if symptomatic",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       Yes if:",
"      </td>",
"      <td rowspan=\"4\">",
"       <p>",
"        Annual",
"       </p>",
"       <p>",
"        Cardiology examination required",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Asymptomatic",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       At least 1 month after drug or other therapy is successful",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Cleared by cardiologist",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"3\">",
"       Dilated cardiomyopathy",
"      </td>",
"      <td>",
"       NSVT (LVEF &le;0.40)",
"      </td>",
"      <td>",
"       No",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Sustained VT, any LVEF",
"      </td>",
"      <td>",
"       No",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Syncope/near syncope, any LVEF: high risk",
"      </td>",
"      <td>",
"       No",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Hypertrophic cardiomyopathy",
"      </td>",
"      <td>",
"       Variable but uncertain prognosis",
"      </td>",
"      <td>",
"       No",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"6\">",
"       Right ventricular outflow VT",
"      </td>",
"      <td rowspan=\"6\">",
"       Favorable prognosis and low risk for syncope",
"      </td>",
"      <td>",
"       No, if symptomatic",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Yes, if asymptomatic",
"      </td>",
"      <td>",
"       <p>",
"        Annual",
"       </p>",
"       <p>",
"        Recommend evaluation by cardiologist",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       Yes if:",
"      </td>",
"      <td rowspan=\"4\">",
"       <p>",
"        Annual",
"       </p>",
"       <p>",
"        Evaluation by cardiologist required",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       At least 1 month after drug or other therapy successful",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Asymptomatic",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Cleared by electrophysiologist",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"5\">",
"       Idiopathic left ventricular VT",
"      </td>",
"      <td rowspan=\"5\">",
"       Favorable prognosis and low risk for syncope",
"      </td>",
"      <td>",
"       No, if symptomatic",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Yes, if asymptomatic",
"      </td>",
"      <td>",
"       <p>",
"        Annual",
"       </p>",
"       <p>",
"        Recommend evaluation by cardiologist",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       Yes if:",
"      </td>",
"      <td rowspan=\"3\">",
"       <p>",
"        Annual",
"       </p>",
"       <p>",
"        Evaluation by cardiologist required",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       At least 1 month after successful drug therapy or ablation",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Cleared by electrophysiologist",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Long QT interval syndrome",
"      </td>",
"      <td>",
"       High risk for ventricular arrhythmic death",
"      </td>",
"      <td>",
"       No",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Brugada syndrome",
"      </td>",
"      <td>",
"       High risk for ventricular arrhythmic death",
"      </td>",
"      <td>",
"       No",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
